            this._toggleVisible('easiformWaiting', 'hide') ;
            if(evtObject.target.status != 200) {
                this._displayFormProgressMessage('easiform_general_progress', oneLevelMessage.message, 'failing') ;
                return false ;
            }
            // commented as per EASI-4045 : else this._displayFormProgressMessage('easiform_general_progress', "Form success", 'done', 'easiformWaitingMsg') ;
            
            var resultSuccess = JSON.parse(oneLevelMessage.message) ;
